import React from 'react';
import { useLocation } from 'react-router-dom';

function PotorPage() {
  const location = useLocation();
  const receivedData = location.state;

  return (
    <div>
      <h2>Destination Page</h2>
      <p>Received Data</p>
    </div>
  );
}

export default PotorPage;
